These Scrabble tiles that spell out live, love,  laugh will be a welcome addition to any room in the household. Made from reclaimed Pine boards stained with a cherry stain and two coats of polyurethane to protect the finish.
dimensions of each 

Live  -  11 1/2&quot; x  3 1/2 &quot;
Love - 11 1/2&quot; x  3 1/2 &quot;
Laugh - 14 1/2&quot; x 3 1/2&quot;
